import React from 'react'
import { Link, useLocation } from 'react-router-dom'
import LandingPage from './LandingPage';

export default function NavBar() {


  return (
    <div>
       
        <>
        <Link to='/home'>
            <h3>Home</h3>
        </Link>
        <Link to='/activities'>
            <h3>Add an activity</h3>
        </Link>
        </>
        



    </div>
  )
};
